				color: white;
			}
			img {
				max-width: 50%;
				display: block;
				margin: 0 auto;
				padding-top: 150px;
			}
		`}</style>

		<style jsx global>{`
			body {
				background: black;
				text-align: center;

			}
		`}</style>

		</div>
